import './App.css';
import { useState } from 'react';

function App() {
  const [state, setState] = useState([]);

  const fetchTeams = () => {
    fetch('/competitions/')
        .then(res => {
          console.log(res);
          return res.json()
        })
        .then(data => setState(data.toString()));
  }

  const printState = (s) => {
    return s;
  };

  return (
    <section>
      <button onClick={() => fetchTeams()}>GO</button>
      <div>{printState(state)}</div>
    </section>
  );
}

export default App;
